Hi Amy,

You need to configure your volume settings. On your task bar is the
little thing that looks like a megaphone right click on it & hit open
volume control.

Click on options & then click on properties, check off line in and
recording at the top. If you have a microphone on and that&#39;s checked off
uncheck it. Click OK. Make sure that line in is checked off and then you
will be able to record.


Andrea

-----Original Message-----
From: EVP-ITC@yahoogroups.com [mailto:EVP-ITC@yahoogroups.com] On Behalf
