Subject: [EVP-ITC] need tech help

anyone know how to do this?
i have my tape recorder &lt;sony clear voice&gt;&lt;small tapes&gt; that i use for
recording evp. I just bought the cord to plug it into my pc, and i can
hear it on my speakers now. I WANT TO UPLOAD THE TAPE to a audio prgram
on the pc.............how to i do that?

amy

